f\u0440\u0438\u0441\u0432\u043e\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u043b\u0438\u043d, \u0418\u043e\u0441\u0438\u0444 \u0412\u0438\u0441\u0441\u0430\u0440\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u0418.&#160;\u0412.&#160;\u0421\u0442\u0430\u043b\u0438\u043d\u0443<\/a> \u0437\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D0%B8%D1%81%D1%81%D0%B8%D0%BC%D1%83%D1%81_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u0438\u0441\u0441\u0438\u043c\u0443\u0441 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u0438\u0441\u0441\u0438\u043c\u0443\u0441 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430<\/a>.<\/li><li>\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u044f \u043f\u043e \u0441\u0432\u044f\u0437\u0438 \u0421\u0428\u0410 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u043b\u0430 \u0442\u0440\u0438\u043d\u0430\u0434\u0446\u0430\u0442\u044c \u043a\u0430\u043d\u0430\u043b\u043e\u0432 \u0434\u043b\u044f \u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u044f.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u043d\u0430 \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%B4%D0%B5%D0%BA%D0%B0%D0%BD%D0%B5%D1%81\" title=\"\u0414\u043e\u0434\u0435\u043a\u0430\u043d\u0435\u0441\">\u0414\u043e\u0434\u0435\u043a\u0430\u043d\u0435\u0437\u0441\u043a\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432<\/a>, \u0432 \u0442\u043e\u0442 \u043c\u043e\u043c\u0435\u043d\u0442 \u0432\u0445\u043e\u0434\u0438\u0432\u0448\u0438\u0445 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a>. \u0427\u0430\u0441\u0442\u044c \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0418\u0442\u0430\u043b\u0438\u0438 \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u0430 \u0424\u0440\u0430\u043d\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u043e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%A2%D0%B0%D1%80%D0%B0%D1%81_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e, \u0422\u0430\u0440\u0430\u0441 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0422\u0430\u0440\u0430\u0441\u0443 \u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u0432 \u042d\u043d\u0444\u0438\u043b\u0434\u0435 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a>) \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D0%BA%D0%BE%D0%BC%D0%B0%D1%82\" title=\"\u0411\u0430\u043d\u043a\u043e\u043c\u0430\u0442\">\u0431\u0430\u043d\u043a\u043e\u043c\u0430\u0442<\/a> \u043f\u043e \u0432\u044b\u0434\u0430\u0447\u0435 \u043d\u0430\u043b\u0438\u0447\u043d\u044b\u0445 \u0434\u0435\u043d\u0435\u0433.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0432 \u0447\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u043e\u0439 \u00ab\u041b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u0435\u00bb \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442, \u043f\u043e\u043b\u0443\u0447\u0438\u0432\u0448\u0438\u0439 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u00ab\u0414\u0432\u0435 \u0442\u044b\u0441\u044f\u0447\u0438 \u0441\u043b\u043e\u0432\u00bb \u0438 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0432\u0441\u0435\u0445 \u0441\u043b\u043e\u0451\u0432 \u0447\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u043e\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430, \u0441 \u043f\u0440\u0438\u0437\u044b\u0432\u043e\u043c \u043a \u0431\u043e\u043b\u0435\u0435 \u0431\u044b\u0441\u0442\u0440\u043e\u043c\u0443 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0443 \u043a \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0438. \u042d\u0442\u043e \u0432\u043e\u0437\u0437\u0432\u0430\u043d\u0438\u0435 \u0441\u0442\u0430\u043b\u043e \u043a\u0443\u043b\u044c\u043c\u0438\u043d\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u043c \u043f\u0443\u043d\u043a\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%B5%D1%81%D0%BD%D0%B0\" title=\"\u041f\u0440\u0430\u0436\u0441\u043a\u0430\u044f \u0432\u0435\u0441\u043d\u0430\">\u041f\u0440\u0430\u0436\u0441\u043a\u043e\u0439 \u0432\u0435\u0441\u043d\u044b<\/a>. \u0420\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430 \u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0441\u0442\u0440\u0430\u043d \u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430 \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b\u043e \u043e\u0442 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0441\u0432\u0435\u0440\u0442\u044b\u0432\u0430\u043d\u0438\u044f \u0440\u0435\u0444\u043e\u0440\u043c, \u0447\u0440\u0435\u0432\u0430\u0442\u044b\u0445 \u00ab\u043a\u043e\u043d\u0442\u0440\u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0435\u0439\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 \u0437\u0430\u043f\u0443\u0441\u043a \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u043e\u0433\u043e \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u0430\u0431\u043b\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7-30\" title=\"\u0421\u043e\u044e\u0437-30\">\u0421\u043e\u044e\u0437-30<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0434\">1980<\/a>&#160;\u2014 \u043d\u0430\u0434 \u0422\u0438\u0440\u0440\u0435\u043d\u0441\u043a\u0438\u043c \u043c\u043e\u0440\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-9_%D0%BD%D0%B0%D0%B4_%D0%A2%D0%B8%D1%80%D1%80%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%BC_%D0%BC%D0%BE%D1%80%D0%B5%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-9 \u043d\u0430\u0434 \u0422\u0438\u0440\u0440\u0435\u043d\u0441\u043a\u0438\u043c \u043c\u043e\u0440\u0435\u043c\">\u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0441\u044f \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 Douglas DC-9<\/a>. \u041f\u043e\u0433\u0438\u0431 81 \u0447\u0435\