3e\u0433\u043e \u043f\u0440\u0430\u0432\u0430 \u0438 \u0441\u0443\u0432\u0435\u0440\u0435\u043d\u0438\u0442\u0435\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%B0%D1%80%D0%B0%D0%B3%D1%83%D0%B0\" title=\"\u041d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430\">\u041d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430<\/a> \u0437\u0430 \u043e\u043a\u0430\u0437\u0430\u043d\u0438\u0435 \u043f\u043e\u043c\u043e\u0449\u0438 \u043d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430\u043d\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D0%B0%D1%81\" title=\"\u041a\u043e\u043d\u0442\u0440\u0430\u0441\">\u043a\u043e\u043d\u0442\u0440\u0430\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0_%D0%9B%D0%B8%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D0%BC_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB%D0%B5\" title=\"\u041a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 \u041b\u0438\u043e\u043d\u0441\u043a\u043e\u043c \u0432\u043e\u043a\u0437\u0430\u043b\u0435\">\u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u0434\u0432\u0443\u0445 \u043f\u0440\u0438\u0433\u043e\u0440\u043e\u0434\u043d\u044b\u0445 \u043f\u043e\u0435\u0437\u0434\u043e\u0432<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB\" title=\"\u041b\u0438\u043e\u043d\u0441\u043a\u0438\u0439 \u0432\u043e\u043a\u0437\u0430\u043b\">\u041b\u0438\u043e\u043d\u0441\u043a\u043e\u043c \u0432\u043e\u043a\u0437\u0430\u043b\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u043e 56 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, 57 \u0431\u044b\u043b\u0438 \u0440\u0430\u043d\u0435\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u0440\u0430\u0437\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%B0%D1%80%D0%B0%D0%B3%D1%83%D0%B0\" title=\"\u041d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430\">\u043d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430\u043d\u0441\u043a\u0438\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D0%B0%D1%81\" title=\"\u041a\u043e\u043d\u0442\u0440\u0430\u0441\">\u043a\u043e\u043d\u0442\u0440\u0430\u0441<\/a>, \u0441\u0438\u043c\u0432\u043e\u043b\u0438\u0437\u0438\u0440\u0443\u044e\u0449\u0430\u044f \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%9D%D0%B8%D0%BA%D0%B0%D1%80%D0%B0%D0%B3%D1%83%D0%B0\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u041d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0432 \u041d\u0438\u043a\u0430\u0440\u0430\u0433\u0443\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A2%D0%B0%D0%B4%D0%B6%D0%B8%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B5\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\u0435\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0432 \u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\u0435<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2010_%D0%B3%D0%BE%D0%B4\" title=\"2010 \u0433\u043e\u0434\">2010<\/a>&#160;\u2014 \u0432 \u0418\u0441\u043b\u0430\u043d\u0434\u0438\u0438 \u0432\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u0441\u0438\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8B%D0%B5_%D0%B1%D1%80%D0%B0%D0%BA%D0%B8_%D0%B2_%D0%98%D1%81%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D0%B8\" title=\"\u041e\u0434\u043d\u043e\u043f\u043e\u043b\u044b\u0435 \u0431\u0440\u0430\u043a\u0438 \u0432 \u0418\u0441\u043b\u0430\u043d\u0434\u0438\u0438\">\u0437\u0430\u043a\u043e\u043d \u043e\u0431 \u043e\u0434\u043d\u043e\u043f\u043e\u043b\u044b\u0445 \u0431\u0440\u0430\u043a\u0430\u0445<\/a>, \u0438 \u0432 \u0442\u043e\u0442 \u0436\u0435 \u0434\u0435\u043d\u044c \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0432 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u043e\u0434\u043d\u043e\u043f\u043e\u043b\u044b\u0439 \u0431\u0440\u0430\u043a \u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0433\u043b\u0430\u0432\u0430 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u044d\u0442\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u044b, \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%99%D0%BE%D1%85%D0%B0%D0%BD%D0%BD%D0%B0_%D0%A1%D0%B8%D0%B3%D1%83%D1%80%D0%B4%D0%B0%D1%80%D0%B4%D0%BE%D1%82%D1%82%D0%B8%D1%80\" title=\"\u0419\u043e\u0445\u0430\u043d\u043d\u0430 \u0421\u0438\u0433\u0443\u0440\u0434\u0430\u0440\u0434\u043e\u0442\u0442\u0438\u0440\">\u0419\u043e\u0445\u0430\u043d\u043d\u0430 \u0421\u0438\u0433\u0443\u0440\u0434\u0430\u0440\u0434\u043e\u0442\u0442\u0438\u0440<\/a>.<\/li><\/ul><h3>\u0412 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u0445 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a> \u2014 \u0412 1500 \u043b\u044c\u0435 \u043e\u0442 \u041f\u0430\u0442\u0430\u0433\u043e\u043d\u0438\u0438 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b\u043e \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0441\u0443\u0434\u043d\u043e \u00ab\u0411\u0440\u0438\u0442\u0430\u043d\u0438\u044f\u00bb, \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u043e\u0435 \u043a\u0430\u043f\u0438\u0442\u0430\u043d\u043e\u043c \u0413\u0440\u0430\u043d\u0442\u043e\u043c (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%BD,_%D0%96%D1%8E%D0%BB%D1%8C\" title=\"\u0412\u0435\u0440\u043d, \u0416\u044e\u043b\u044c\">\u0416. \u0412\u0435\u0440\u043d<\/a>, \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%82%D0%B8_%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD%D0%B0_%D0%93%D1%80%D0%B0%D0%BD%D1%82%D0%B0_(%D1%80%D0%BE%D0%BC%D0%B0%D0%BD)\" class=\"mw-redirect\" title=\"\u0414\u0435\u0442\u0438 \u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0430 \u0413\u0440\u0430\u043d\u0442\u0430 (\u0440\u043e\u043c\u0430\u043d)\">\u0414\u0435\u0442\u0438 \u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0430 \u0413\u0440\u0430\u043d\u0442\u0430<\/a>\u00bb).<\/li><\/ul><h2>"}